import { StyleSheet } from 'react-native';

export const textSizeStyles = StyleSheet.create({
    extraSmall: {
        fontSize: 8,
    },
    small: {
        fontSize: 15,
    },
    medium: {
        fontSize: 24,
    },
    large: {
        fontSize: 35,
    },
    XLarge: {
        fontSize: 33,
    },
    XXLarge: {
        fontSize: 40,
    },
});
